import "./NavBarItem.css";
const NavBarItem = () => {
  return (
    <div className="navbar-item">
      <h2>Booking Website</h2>
      <div className="buttons">
        <button>Register</button>
        <button>Login</button>
      </div>
    </div>
  );
};
export default NavBarItem;
